        this._text_25 = this.renderer.createText(null, '\n\n', null);
        this._el_26 = this.renderer.createElement(null, 'p', null);
        this._text_27 = this.renderer.createText(this._el_26, '- Caso o número de jogadores não caiba na mesa, os jogadores serão separados em duas mesas, por sorteio. No momento em que o número de jogares total ainda vivos couber em uma só mesa, os jogadores serão aglutinados na mesma mesa, cada um levando as fichas que tiver. Os blinds aumentarão ao mesmo tempo em cada mesa.', null);
